function pieceTheme (piece) {
  // original theme used by the chessboard.js developer taken from wikipeda
  if (piece.search(/w/) !== -1) {
    return 'static/' + piece + '.png'
  }
  if (piece.search(/b/) !== -1) {
    return 'static/' + piece + '.png'
  }

}
var config = {
  draggable: true,
  dropOffBoard: 'trash',
  sparePieces: false,
  pieceTheme: pieceTheme,
  position: "start" 
}

var board2 = Chessboard("board2", config)

$('#startBtn').on('click', board2.start)
$('#clearBtn').on('click', board2.clear)
